// import Register
// import SearchBar from './Component/SearchBar'
// import axios from 'axios'
import './App.css';

class App extends Component {
  render() {
    return (
      <div className="App">
        {/* <NavBar /> */}
        <switch>
        <Route path="/login" component={LoginContainer} />
          {/* <Register /> */}
        {/* <Login /> */}
        {/* <SearchBar /> */}
        </switch>
      </div>
    );
  }
}

export default App;
